import React from 'react';
import {Link}from 'react-router-dom';
export default function Menu(){
    return (
        <nav id='menu'>
            <Link to='/'>首页</Link>
            <Link to='/corse'>课程安排</Link>
            <Link to='/lecturer'>讲师团队</Link>
        </nav>
    )
}
